import React, {Component} from 'react';


class App extends Component{
    render(){
        return(
            <div className='container-fluid bg' style={{display:'flex', flexDirection:'column', padding: 0}}>

               <div style={{opacity:'100%'}}>
                    <div  className='' style={{backgroundColor:'#FFBB7699', height: '32vh', justifySelf:'center', textAlign:'center'}}>
                        <img src='/image/2x/titre.png' alt='ParticipAct'  style={{width:'12vw'}}/>
                    </div>

                    <div style={{marginTop:'4em'}}>
                        <button className='btn'>Espace volontaire</button>
                        <button className='btn'>Qui sommes nous ?</button>
                        <button className='btn'>Espace association</button>

                    </div>
                </div>
            </div>

        )
    }
}

export default App
